import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <div className="h-screen w-[250px] bg-yellow text-white">
      <div className="h-[120px] w-full flex items-center justify-center">
        <h1 className="text-4xl  font-bold cursor-pointer">
          SCORE<span className="text-black">Info</span>
        </h1>
      </div>
      <div className="h-[250px] w-full  text-xl ">
        <NavLink className="cursor-pointer">World Cup</NavLink>
        <NavLink className="cursor-pointer">Leagues</NavLink>

        <NavLink className="cursor-pointer">Transfers</NavLink>
      </div>
    </div>
  );
};

export default Navbar;
